import React from "react";
import {Navbar,Nav,NavDropdown} from 'react-bootstrap';
import {Link} from 'react-router-dom';

class SideBar extends React.Component{
  render(){
    return(
    <Nav defaultActiveKey="/" className="flex-column">
    <Nav.Item>
      <Link to={"#"} className="nav-link">Add Product</Link>
  </Nav.Item>
  <Nav.Item>
     <Link to={"#"} className="nav-link">Order Product</Link>
  </Nav.Item>
  <Nav.Item>
  <NavDropdown title="View Monthly Sale Report" id="nav-dropdown">
    <NavDropdown.Item><Link to={"#"} className="nav-link">Employee</Link></NavDropdown.Item>
    <NavDropdown.Item><Link to={"#"} className="nav-link">Product</Link></NavDropdown.Item>
    <NavDropdown.Item><Link to={"#"} className="nav-link">Brand</Link></NavDropdown.Item>
  </NavDropdown>
  </Nav.Item>
</Nav>);
  }

}
export default SideBar;
